const sayHello = name => console.log(`Hello ${name}`)
sayHello('João')

const person = {
    name: 'Jimmy Smith',
    age:40,
    heirColor: 'brown',
    eyeColor: 'blue'
}
const careerData = {
    title: 'developer',
    company:'ABC Software'
};

const personWithCareerData = {
    ...person,
    ...careerData,
}
console.log(personWithCareerData)

